import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import CollegeSearch from "./components/pages/CollegeSearch";  // Assuming the file name is CollegeSearch.js
import Login from "./components/pages/Login";
import SignUp from "./components/pages/Signup";

const App = () => {
  return (
    <Router>
      <div
        style={{
          background: "linear-gradient(135deg, rgb(45, 73, 104), #0056b3)",
          minHeight: "100vh", // Ensures the gradient fills the entire height of the page
        }}
      >
        <Routes>
          {/* College Search Page */}
          <Route path="/" element={<CollegeSearch />} />

          {/* Login Page */}
          <Route path="/login" element={<Login />} />

          {/* Sign Up Page */}
          <Route path="/signup" element={<SignUp />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
